-- Insert Shoes
INSERT INTO sneaker(id, name, description, price, is_special, gender, brand_id, created_by, created_date,
                    last_modified_by, last_modified_date)
VALUES (1, 'Air Jordan 1 Low Travis Scott',
        'The Air Jordan 1 Low Fragment Design x Travis Scott nods to the original 2016 Air Jordan 1 Fragment with its simple color blocking. It features a smooth white leather upper with black and royal blue leather overlays. From there, a signature reversed Swoosh and yellowed soles add a Cactus Jack flair to the classic silhouette.',
        150.0, true, 'MALE', 3, 'system', CURRENT_DATE, 'system', CURRENT_DATE),
       (2, 'Nike SB Dunk Low Grey Fog',
        'The Nike Dunk Low Grey Fog features a white leather upper with Grey Fog leather overlays and Swooshes. From there, a matching woven tongue label, heel tab, and sole completes the design. The Nike Dunk Low Grey Fog released in September of 2021 and retailed for $100.',
        134.99, false, 'MALE', 1, 'system', CURRENT_DATE, 'system', CURRENT_DATE),
       (3, 'Yeezy Boost 350 V2 Hyperspace',
        'Try not to dress like a hypebeast after copping the adidas Yeezy Boost 350 V2 Hyperspace. This Yeezy Boost 350 comes with a grey upper, grey translucent stripe, grey midsole, and a Grey sole. These sneakers released in March 2019 and retailed $220. Make some space for some new Yeezys and Buy these now on StockX.',
        366.99, false, 'FEMALE', 2, 'system', CURRENT_DATE, 'system', CURRENT_DATE),
       (4, 'Nike Dunk Low SP Kentucky',
        'Nike celebrated the 35th Anniversary of the Nike Dunk by releasing the Nike Dunk Low SP Syracuse (2020), now available on StockX. The Nike Dunk debuted as part of the 1985 Nike College Colors program, a program that delivered footwear in the school colors of 12 popular basketball programs allowing fans to support their favorite teams from head to toe. This Kentucky colorway was among the first collegiate colorways Nike released, breaking the mold for colorways used on basketball shoes.',
        209.99, false, 'FEMALE', 1, 'system', CURRENT_DATE, 'system', CURRENT_DATE),
       (5, 'Nike Air Force 1 Low SP AMBUSH Phantom',
        'Nike is collaborating with AMBUSH to celebrate the 40th anniversary of the Air Force 1, by releasing the Nike Air Force 1 Low SP AMBUSH Phantom. Ambush and Nike used an off-white Phantom colorway from top to bottom on their Air Force 1 collaboration. Nike used an oversized black swoosh that hangs off the heel, and black AMBUSH branding on the tongue, lace-locks, and insoles.',
        209.99, false, 'MALE', 1, 'system', CURRENT_DATE, 'system', CURRENT_DATE),
       (6, 'Nike Air Force 1 Mid Off-White Graffiti White',
        'Nike is collaborating with AMBUSH to celebrate the 40th anniversary of the Air Force 1, by releasing the Nike Air Force 1 Low SP AMBUSH Phantom. Ambush and Nike used an off-white Phantom colorway from top to bottom on their Air Force 1 collaboration. Nike used an oversized black swoosh that hangs off the heel, and black AMBUSH branding on the tongue, lace-locks, and insoles.',
        209.99, false, 'MALE', 1, 'system', CURRENT_DATE, 'system', CURRENT_DATE),
       (7, 'Nike Dunk Low QS LeBron James Fruity Pebbles',
        'The Nike Dunk Low QS LeBron James Fruity Pebbles come in Habanero Red mixed with Laser Blue and White colorway. This Dunk Low sneaker by Nike features a smooth white leather base contrasted with habanero red overlays and a laser blue dressed side Swoosh. The shoes white tongue is decorated with the woven Fruity Pebbles tags, while the heel tab is embroidered with LeBrons LJ logo. The interior part of the sneaker is a Nike-branded sock liner revealing another Fruity Pebble graphic print. Concluding the design is the treaded milky translucent rubber outsole.',
        159.99, false, 'MALE', 1, 'system', CURRENT_DATE, 'system', CURRENT_DATE),
       (8, 'Nike Air Force 1 Low White Supreme',
        'Supreme and Nike paid homage to an NYC classic with the release of the Nike Air Force 1 Low Supreme White, now available on StockX. This collaboration adds Supremes world-renowned Box Logo to the side of a traditional all-white Air Force 1 design.',
        209.99, false, 'MALE', 1, 'system', CURRENT_DATE, 'system', CURRENT_DATE),
       (9, 'Air Jordan 1 Low Shadow Toe',
        'The Air Jordan 1 Low Shadow Toe (2021) is a sleek and stylish take on the classic Jordan 1 silhouette. The highlight of this shoe is the Shadow Toe box, which gives the shoe a unique look. Featuring a black and grey upper with a white midsole and translucent, grey outsole, this shoe has a simple but refined look. It is distinct from other shoes thanks in part to the Air Jordan embroidery on the collar. The design features as well a basketball under the Air Jordan words.',
        129.99, false, 'MALE', 1, 'system', CURRENT_DATE, 'system', CURRENT_DATE),
       (10, 'Air Jordan 1 Low Ice Blue Black',
        'The Air Jordan 1 Low Ice Blue Black GS is a grade school release in an ice blue, white, and black color scheme. This sneaker features an all-leather upper with a cream leather base that matches the laces and tongue. Ice blue leather details highlight the overlays, while a black Swoosh adds contrast. It also has an Air Jordan Wings logo on the heel, the Jumpman branding on the tongue, and a perforated toe box. A white midsole and beige rubber outsole with AIR units complete the design.',
        129.99, false, 'FEMALE', 1, 'system', CURRENT_DATE, 'system', CURRENT_DATE),
       (11, 'Air Jordan 1 Low Travis Scott Olive',
        'Travis Scott is back in 2023, following up his previous release of the Air Jordan 1 Retro Low Phantom in 2022, with another Air Jordan 1 Retro Low collaboration. The Jordan 1 Retro low OG SP Travis Scott Olive released exclusively in womens sizing. The Air Jordan 1 Low OG SP Travis Scott Olive is constructed with white leather and black nubuck uppers. Travis continued to use his signautre reverse style Nike Swoosh, in an olive green colorway. The limited edition sneakers have an aged midsole that sits on top of an olive green outsole.',
        129.99, false, 'FEMALE', 3, 'system', CURRENT_DATE, 'system', CURRENT_DATE),
       (12, 'Adidas Samba OG Cloud White',
        'The adidas Samba OG Cloud White Core Black (Women''s) represents a contemporary take on a timeless style, emanating an aesthetic charm that goes beyond its original athletic purpose. Crafted from full-grain leather, the upper of the Cloud White Core Black adidas Samba OG (Women''s) offers a sturdy and resilient construction. A gray suede, paired with a contrasting black heel tab, introduces an element of sophistication to the overall design. The iconic serrated 3-Stripes appear in black on both the lateral and medial sides, creating a visually striking contrast. Enhancing the shoe''s unique identity, a Bluebird tongue label and a foil logotype mark its distinctive DNA.',
        129.99, false, 'FEMALE', 2, 'system', CURRENT_DATE, 'system', CURRENT_DATE),
       (13, 'Air Jordan 4 Pine Green',
        'Nike SBs collaboration with Jordan helps create the ultimate sneaker for the skatepark to the basketball court, with the release of the Jordan 4 Retro SB Pine Green. The Jordan 4 Retro SB Pine Green used a white leather upper with a Neutral Grey suede mudguard. The limited edition sneakers sit on top of a white and Pine Green midsole which is highlighted by a red air unit. Nike used a gum outsole to help with increased grip while skateboarding.',
        129.99, false, 'MALE', 1, 'system', CURRENT_DATE, 'system', CURRENT_DATE);



